import { ButtonText, InputIcon, InputSlot, View } from "@gluestack-ui/themed";
import * as React from "react";
import { KeyboardAwareScrollView } from "react-native-keyboard-aware-scroll-view";
import { Button, Box, Heading, Text } from "@gluestack-ui/themed";
import {
  FormControl,
  Pressable,
  FormControlLabel,
  FormControlLabelText,
  FormControlHelper,
  FormControlHelperText,
  FormControlError,
  FormControlErrorIcon,
  FormControlErrorText,
  Input,
  InputField,
  Radio,
  RadioGroup,
  RadioIcon,
  RadioIndicator,
  RadioLabel,
  Checkbox,
  CheckboxGroup,
  CheckboxIndicator,
  CheckboxIcon,
  CheckboxLabel,
  Textarea,
  TextareaInput,
  Select,
  SelectTrigger,
  SelectInput,
  SelectIcon,
  SelectPortal,
  SelectBackdrop,
  SelectContent,
  SelectDragIndicatorWrapper,
  SelectDragIndicator,
  SelectItem,
  Slider,
  SliderTrack,
  SliderFilledTrack,
  SliderThumb,
  Switch,
  Modal,
  ModalBackdrop,
  ModalContent,
  ModalHeader,
  ModalCloseButton,
  ModalBody,
  ModalFooter,
  HStack,
  Center,
  Icon,
  CircleIcon,
  CheckIcon,
  AlertCircleIcon,
  ChevronDownIcon,
  ScrollView,
} from "@gluestack-ui/themed";
import { useNavigation } from "@react-navigation/native";
import { useState } from "react";
import Background_Login from "../../components/BackGround";
import { TouchableOpacity } from "react-native";
import { EyeIcon, EyeOffIcon } from "lucide-react-native";
import { screen } from "../../utils";

const Login = () => {
  const [showPassword, setShowPassword] = useState(false);
  const handleState = () => {
    setShowPassword((showState) => {
      return !showState;
    });
  };

  const navigation = useNavigation();
  const goToRegister = () => {
    navigation.navigate(screen.account.register);
  };

  const [formData, setData] = React.useState({});
  const [errors, setErrors] = React.useState({});
  let regex_email =
    /[a-zA-Z0-9_]+([.][a-zA-Z0-9_]+)@[a-zA-Z0-9_]+([.][a-zA-Z0-9_]+)[.][a-zA-Z]{2,5}$/;

  const digit = /[0-9]/;
  const upperCase = /[A-Z]/;
  const lowerCase = /[a-z]/;
  const nonAlphanumeric = /[^0-9A-Za-z]/;

  const isStrongPassword = (password) =>
    [digit, upperCase, lowerCase, nonAlphanumeric].every((re) =>
      re.test(password)
    ) &&
    password.length >= 8 &&
    password.length <= 32;

  const validate = () => {
    setErrors({});
    console.log("email", formData.email);
    console.log("password", formData.password);
    if (regex_email.test(formData.email) != false) {
      console.log("regex_email", formData.email);
      setErrors({
        ...errors,
        email: "Email is not valid",
      });
      return false;
    }
    if (!isStrongPassword(formData.password)) {
      setErrors({
        ...errors,
        password: "Password is not valid",
      });
      return false;
    }
    return true;
  };

  const onSubmit = () => {
    validate()
      ? navigation.navigate("Navigation", { email: formData.email })
      : console.log("Validation Failed", errors);
  };

  return (
    <KeyboardAwareScrollView>
      <View flex={0.5} backgroundColor="#000000">
        <Background_Login></Background_Login>
        <Box justifyContent="center" alignItems="center" marginTop={"$1/2"}>
          <Heading
            color="$white"
            lineHeight="$5xl"
            size="2xl"
            style={{
              textShadowColor: "black",
              textShadowOffset: {
                width: 1,
                height: 1,
              },
            }}
          >
            Login
          </Heading>

          <FormControl
            isInvalid={false}
            size={"lg"}
            isDisabled={false}
            isRequired={true}
            w={"$4/5"}
            justifyContent="center"
            marginTop={"$5"}
          >
            <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
              <InputField
                type="text"
                placeholder="Email"
                backgroundColor="white"
                onChangeText={(value) =>
                  setData({
                    ...formData,
                    email: value,
                  })
                }
              />
            </Input>
          </FormControl>

          <FormControl
            isInvalid={false}
            size={"lg"}
            isDisabled={false}
            isRequired={true}
            w={"$4/5"}
            marginTop={"$5"}
          >
            <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
              <InputField
                type={showPassword ? "text" : "password"}
                placeholder="Password"
                backgroundColor="white"
                onChangeText={(value) =>
                  setData({
                    ...formData,
                    password: value,
                  })
                }
              />
              <InputSlot pr="$3" onPress={handleState} backgroundColor="white">
                <InputIcon
                  as={showPassword ? EyeIcon : EyeOffIcon}
                  color="$darkBlue500"
                />
              </InputSlot>
            </Input>
          </FormControl>

          <Button
            action={"primary"}
            variant={"link"}
            size={"md"}
            isDisabled={false}
          >
            <ButtonText color="white" onPress={goToRegister}>
              Don't have an account? Sign up here
            </ButtonText>
          </Button>

          {/* <Button w={"$40"} action={"primary"} variant={"solid"} size={"lg"} isDisabled={false} bg="$black" // Cambia el color de fondo a un azul más vibrante
          borderRadius={18} 
          onPress={onSubmit} paddingHorizontal={0} 
          paddingVertical={0} 
          marginTop={"$4"}>
          <ButtonText color="$white" fontSize={18}>
            Login
          </ButtonText>
        </Button> */}

          <TouchableOpacity
            style={{
              backgroundColor: "black",
              padding: 10,
              borderRadius: 16,
              alignItems: "center",
              width: 110,
            }}
            onPress={onSubmit}
          >
            <Text color="white" fontSize={18}>
              Login
            </Text>
          </TouchableOpacity>
        </Box>
      </View>
    </KeyboardAwareScrollView>
  );
};

export default Login;
